import React,{useState} from 'react';
import {connect} from 'react-redux';
import TodoList from '../todo-list';

//передаем списку все
const mapStateToProps=(state) =>{
      const todos = state.todos;
      return {
        todos
      }
    }

export default connect(mapStateToProps)(TodoList);
